                //{" "}
                <Row>
                  // <Col className="text-right" sm="6"></Col>
                </Row>
              </CardHeader>
            </Card>
          </Col>
        </Row>
      </div>

      <h1>안녕하세요 아이콘 페이지 입니다. </h1>
    </>
  );
}

export default Icons;
